entry.value:
import java.text.SimpleDateFormat
import java.util.Date

def flowFile = session.get()
if(!flowFile) return

def hora1 = flowFile.getAttribute('tempo_fim')
def hora2 = flowFile.getAttribute('tempo_inicio')

// Verifique se os atributos no esto vazios
if(hora1 == null || hora2 == null) {
    log.error("Um dos atributos de hora est vazio")
    session.transfer(flowFile, REL_FAILURE)
    return
}

// Faa o parse dos horrios no formato apropriado (por exemplo, HH:mm:ss)
def sdf = new SimpleDateFormat("HH:mm:ss")
def date1 = sdf.parse(hora1)
def date2 = sdf.parse(hora2)

// Subtrai os horrios
def diff = date1.time - date2.time

// Converta a diferena de volta para o formato apropriado (se necessrio)
def result = sdf.format(new Date(diff))

// Defina o resultado em um novo atributo
flowFile = session.putAttribute(flowFile, 'resultado', result)

session.transfer(flowFile, REL_SUCCESS)
